// @flow strict

import * as React from 'react';
import { useState } from 'react';
import {useNavigate} from 'react-router-dom'
import { BrowserRouter, Link, Route, Router, Routes } from 'react-router-dom';
import logo from '../img/logo.png'
import axios from 'axios';
import background from '../autho/bg.jpg';
import Navar from '../auth1/client/Navar';
// import client from '../auth1/client/Home';

function CustomerSignup() {
    const navigate = useNavigate();
    const [user, setUser] = useState({
        fname: "",
        lname: "",
        email: "", 
        phoneNumber: "",
        age: "",
        address:"",
        zip:"",
        password: "",
        confirmPass: "",
      });
      const handleChange = (e) => {
        const { name, value } = e.target;
        setUser({
          ...user,
          [name]: value,
        });
      };

      const handleSubmit = async e => {
        const {
            fname,
            lname,
            email,
            phoneNumber,
            age,
            address,
            zip,
            password,
            confirmPass,
          } = user;
        console.log(email)
        console.log(password)
        console.log()
        e.preventDefault()
        try{
            await  axios.post('http://localhost:3001/customerSignUp',user)
         //   localStorage.setItem('firstLogin',true)
            window.location.href ="/Navar";

        }catch(err)
        {
            alert(err.response.data.msg)
        }

    }


    return (
        // @flow strict
        <div style={{ backgroundImage: `url(${background})` }}>
        <div className='row-4'>
            <div className=" text-center ">
                <img className='rounded-circle' src={logo} width="250px" />
                <div className="text-center m-5-auto">
            <h2 className= 'text-white'>Customer Register </h2>
            <h4 className= 'text-white'>Create Your  Account</h4>
            <form onSubmit={handleSubmit}>
                <p>
                    <label>First Name</label><br/>
                    <input type="text" required 
                    name="fname"
                    value={user.fname}

                    onChange={handleChange}/>
                </p>
                <p>
                    <label>Last Name</label><br/>
                    <input type="text"  required 
                    name="lname"
                    value={user.lname}

                    onChange={handleChange}/>
                </p>

                <p>
                    <label>Email Address</label><br/>
                    <input type="email"  required 
                    name="email"
                    value={user.email}

                    onChange={handleChange}/>
                </p>
                <p>
                    <label>Phone Number</label><br/>
                    <input type="text"  required
                    name="phoneNumber"
                    value={user.phoneNumber}

                    onChange={handleChange} />
                </p>

                <p>
                    <label>Enter Your Age</label><br/>
                    <input type="number"  required 
                    name="age"
                    value={user.age}
                    onChange={handleChange}
                    />
                </p>
                <p>
                    <label>Address</label><br/>
                    <input type="text"  required 
                    name="address"
                    value={user.address}

                    onChange={handleChange}/>
                </p>

                <p>
                    <label>Zip Code</label><br/>
                    <input type="number"  required 
                    name="zip"
                    value={user.zip}
                    onChange={handleChange}
                    />
                </p>
                <p>
                    <label>Password</label><br/>
                    <input type="password"  required name="password" value={user.password} onChange={handleChange}/>
                </p>
                <p>
                    <label>Enter Password Again</label><br/>
                    <input type="password" required name="confirmPass"
                    value={user.confirmPass}
                    onChange={handleChange}/>
                </p>
                <p>
                    <input type="checkbox" name="checkbox" id="checkbox" required /> 
                    <span>I agree all statements in <a href="https://google.com" target="_blank" rel="noopener noreferrer">terms of service</a>
                    </span>.
                </p>
                <p>
                    <button id="sub_btn" type="submit">Register</button>
                    {/* <input type="button" onClick={register} value="Register"/> */}
                </p>

            </form> 
            <footer>
                <p><Link to="/" className= 'text-white'><b>Back to Homepage</b></Link>.</p>
                <p className= 'text-white'> <b>Already Have an Account?</b> <Link to="/CustomerLogin" className= 'text-white'><b>Log In </b></Link>.</p>
            </footer>
        </div>
        </div>
        </div>
        </div>




    );
};

export default CustomerSignup;
